import React, { Component } from 'react';
import ListItem from 'material-ui/ListItem';
import MobileTearSheet from 'material-ui/MobileTearSheet';

export default class List extends Component {

    constructor() {
        super();
        this.state = {
            open: false,
            todos: [],
            notetext: ""
          };
    }

    _renderTodos(){
        return this.state.todos.map(el => {
            return <ListItem primaryText={el.text} key={el.id}/>
        })
    }

    render(){
        return(
            <MobileTearSheet>
                <List>
                    {this._renderTodos()}
                </List>
            </MobileTearSheet>
        )
    }
}
